import './MatchBox.css'
import '/Users/sathwikanil/Desktop/sathwik/sath/cricer/frontend/src/components/css/teams.css'

function MatchBoxItem(props) {
    const inn = props.inn
    return (<div className={`matchbox_inn ${inn.color}1`}>
        <div className='matchbox_teamname'>
            {inn.teamname}
        </div>
        <div className='matchbox_score'>
            {inn.score}
        </div>
    </div>
    );
}
function MatchBox(props){
    let p = props.match
    return(
        <a className={`matchbox ${p.tour}`} href={`http://localhost:3000/match/${props.m_id}/summary`}>
            <div className='matchbox_header'>
                {p.tour_name}
            </div>
            <div className='matchbox_body'>
                <MatchBoxItem inn={p.inn1}/>
                <MatchBoxItem inn={p.inn2}/>
            </div>
            <div className='matchbox_footer'>
                {p.venue}
            </div>
        </a>
    )
}

export default MatchBox;
